import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Importa Routes en lugar de Switch
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Home from './Routes/Home'; // Importa el componente Home (o cualquier otro componente que desees asociar a una ruta)
import Contacto from './Routes/Contact'; // Importa el componente Contacto (si tienes uno)
import Favoritos from './Routes/Favs'; // Importa el componente Favoritos (si tienes uno)

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes> {/* Cambia Switch por Routes */}
          <Route path="/home" element={<Home />} /> {/* Ruta para la página de inicio */}
          <Route path="/contacto" element={<Contacto />} /> {/* Ruta para la página de contacto */}
          <Route path="/favs" element={<Favoritos />} /> {/* Ruta para la página de favoritos */}
          {/* Agrega más rutas y componentes según sea necesario */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
